import ast
import csv
import numpy as np
from sklearn.metrics.pairwise import cosine_similarity
import os

def parse_embedding(embedding_str):
    embedding_dict = ast.literal_eval(embedding_str)
    return np.array(embedding_dict['embedding'])


def load_embeddings_from_csv(csv_file):
    embeddings = []
    try:
        with open(csv_file, 'r', newline='') as file:
            reader = csv.DictReader(file)
            for row in reader:
                embedding = parse_embedding(row['Embedding'])
                embeddings.append(embedding)
    except FileNotFoundError:
        print(f"File '{csv_file}' not found. Skipping this pair.")
    return np.array(embeddings)

def compute_similarity(embeddings1, embeddings2):
    similarities = cosine_similarity(embeddings1, embeddings2)
    return similarities.flatten()
def compute_and_save_similarity_for_pairs(true_pairs, output_file):
    with open(output_file, 'w', newline='') as file:
        writer = csv.writer(file)
        writer.writerow(['CSV1', 'CSV2', 'Similarities', 'IsCorrect'])

        for pair in true_pairs:
            csv1_file = pair[0] + '_features.csv'
            csv2_file = pair[1] + '_features.csv'

            if not (os.path.exists(csv1_file) and os.path.exists(csv2_file)):
                print(f"One or both CSV files not found for pair: {pair}. Skipping...")
                continue

            embeddings1 = load_embeddings_from_csv(csv1_file)
            embeddings2 = load_embeddings_from_csv(csv2_file)

            print("Shape of embeddings1:", embeddings1.shape)
            print("Shape of embeddings2:", embeddings2.shape)

            similarities = compute_similarity(embeddings1, embeddings2)

            csv1_name = csv1_file.replace('_features', '')
            csv2_name = csv2_file.replace('_features', '')
            writer.writerow([csv1_name, csv2_name, similarities, False])


